import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (

    <div className="container">
      <header>
        <h1>FutureTube</h1>
        <input placeholder="Buscar"></input>
      </header>
      <section>
        <nav>
          <ul>
            <li>Início</li>
            <li>Em alta</li>
            <li>Incrições</li>
            <li>originais</li>
            <li>Biblioteca</li>
            <li>Histórico</li>
          </ul>
        </nav>
      </section>
      <footer>Oi eu moro no footer!</footer>
    </div>

  );
}

export default App;
